import React from 'react';
import { connect } from 'react-redux';
import { userActions } from '../_actions';
import '../../public/scss/log_in.scss';
import { Link } from 'react-router-dom';
import { isValidEmailAddress } from '../_helpers/validators';
import {withTranslation} from "react-i18next";

class Index extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      login: '',
      password: '',
      submitted: false,
      forgottenEmail: '',
      authentication: props.authentication,
      resetPasswordModal: false,
      isOpenSuccessForgotModal: false

    };

    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
    this.sendRequest = this.sendRequest.bind(this);
    this.textInput = React.createRef();
    this.resetPassword = this.resetPassword.bind(this);
  }

  componentDidMount() {
    const { company } = this.props.match.params;

    document.title = this.props.t('Логин в системе Онлайн-запись');

    if (company) {
      this.props.dispatch(userActions.activate(company));
    }
  }


  componentWillReceiveProps(newProps) {
    if ( JSON.stringify(this.props.authentication) !== JSON.stringify(newProps.authentication)) {
      this.setState({ ...this.state, authentication: newProps.authentication });
      setTimeout(() => {
        this.setState({ ...this.state, authentication: [] });
      }, 3000);

      if (newProps.authentication && newProps.authentication.status==='reset.email' &&
        newProps.authentication.error===-1) {
        this.setState({isOpenSuccessForgotModal: true}, () => {
          setTimeout(() => {
            this.setState({
              'login': newProps.authentication.email,
              'password': '',
              'authentication': [],
              'resetPasswordModal': false,
              'forgottenEmail': '',
            }, () => {
              this.setState({isOpenSuccessForgotModal: false, resetPasswordModal: false});
              $('.modal_reset_password').modal('hide');
            });
          }, 3000);
        });
      }

      if (newProps.authentication && newProps.authentication.error && (newProps.authentication.error.code === 5 ||
                newProps.authentication.error.code === 6)) {
        setTimeout(() => {
          this.setState({ ...this.state, authentication: [] });
        }, 3000);
      }
    }
  }

  handleChange(e) {
    const { name, value } = e.target;
    this.setState({ [name]: value });
  }

  handleSubmit(e) {
    e.preventDefault();

    this.setState({ submitted: true });
    const { login, password } = this.state;
    const { dispatch } = this.props;
    if (login && password) {
      dispatch(userActions.login(login, password));
    }
  }

  render() {
    const { login, password, submitted, forgottenEmail, emailIsValid, authentication } = this.state;
    const { t } = this.props;
    // const isLightTheme = JSON.parse(localStorage.getItem('lightTheme')) || true;

    return (
      <div>
        <div className="sign_up_container sign_in_container content-pages-bg">
          <div className="logo_sign_in">
            <div>
              <h2 className="logo-title">{t('Добро пожаловать!')}</h2>
              <p className="logo-description">{t("Войдите чтобы использовать")}<br/>Online-zapis.com</p>
            </div>
            {/* eslint-disable-next-line */}
            <img src="data:image/svg+xml;base64," alt="Login image"/>
          </div>
          <div className="sign_in">
            <form name="form" onSubmit={this.handleSubmit}>
              <span className={'label-text' + (submitted && !login ? ' red-color' : '')}>Email</span>
              <input
                type="text"
                className={'form-group' + (submitted && !login ? ' redBorder' : '')}
                name="login"
                value={login}
                onChange={this.handleChange}
              />
              <span className={'label-text' + (submitted && !password ? ' red-color' : '')}>{t("Пароль")}</span>
              <input
                type="password"
                className={'form-group' + (submitted && !password ? ' redBorder' : '')}
                name="password"
                value={password}
                onChange={this.handleChange}
              />
              {authentication && authentication.error && authentication.error.code === 5 &&
                <p className="alert-danger p-1 rounded pl-3 mb-2">
                  {t("Аккаунт не активирован. Проверьте email и завершите регистрацию")}
                </p>
              }
              {authentication && authentication.error && authentication.error.code === 6 &&
                <p className="alert-danger p-1 rounded pl-3 mb-2">{t("Неверный логин или пароль")}</p>
              }
              <button className="button sign_in_button" type="submit">{t("Войти")}</button>

              {authentication.loggingIn &&
                // eslint-disable-next-line
                <img src="data:image/gif;base64," />
              }
            </form>
            <a
              href="#"
              onClick={()=>this.resetPassword()}
              className="popup_forgot"
              data-toggle="modal"
              data-target=".modal_reset_password"
            >
              {t("Забыли пароль?")}
            </a>
          </div>

          <div className="block_bottom">
            <span className="sign_up_text">{t("Нет аккаунта?")}&nbsp;</span>
            <Link to="/register">
              <p onClick={() => this.props.dispatch(userActions.clearErrors())} className="sign_up_open">{t("Создать")}</p>
            </Link>
          </div>
        </div>

        <div className="modal modal_reset_password" ref='modal'>
          <div className="modal-dialog modal-dialog-lg modal-dialog-centered">
            <div className="modal-content">
              <div className="modal-header">
                <h4 className="modal-title">{t("Сброс пароля")}</h4>
                <button type="button" className="close" data-dismiss="modal" />
              </div>
              <div className="form-group mr-3 ml-3">
                <p className="email-label">{t("Электронный адрес")}</p>
                <input
                  type="text"
                  name="forgottenEmail"
                  onChange={this.handleChange}
                  value={forgottenEmail}
                  onKeyUp={() => this.setState({
                    emailIsValid: isValidEmailAddress(forgottenEmail),
                  })}
                  className={'email-input' + (!isValidEmailAddress(forgottenEmail) && forgottenEmail !== ''
                    ? ' redBorder'
                    : '')
                  }
                />
                {authentication && authentication.error && authentication.error.code === 2 &&
                <p className="alert-danger p-1 rounded pl-3 mb-2">{t("Такого email не существует!")}</p>
                }
                {
                  authentication && authentication.status && authentication.status === 'reset.email' &&
                  (!authentication.error || authentication.error===-1) &&
                    <p className="alert-success p-1 rounded pl-3 mb-2">
                      {t("Инструкция по сбросу пароля отправлена на Ваш Email")}
                    </p>
                }
                <button
                  className={((!forgottenEmail || (!emailIsValid) ||
                    authentication.forgotPassLoading) && 'disabledField') + ' button text-center'}
                  type="button"
                  onClick={forgottenEmail && emailIsValid && this.sendRequest}>{t("Отправить")}
                </button>
                {authentication.forgotPassLoading &&
                  <img
                    style={{ width: '57px' }}
                    // eslint-disable-next-line
                    src="data:image/gif;base64,"
                  />
                }
              </div>
            </div>
          </div>
          <div>
            {this.state.isOpenSuccessForgotModal &&
            <div className="message-is-sent-wrapper">
              <div className="message-is-sent-modal">
                <button onClick={()=> this.setState({ isOpenSuccessForgotModal: false, resetPasswordModal: false })} className="close" />
                <div className="modal-body">
                  <img src={`${process.env.CONTEXT}public/img/icons/Check_mark.svg`} alt="message is sent image"/>
                  <p className="body-text">
                    {t("Инструкция по сбросу пароля отправлена на Ваш Email")}
                  </p>
                </div>
              </div>
            </div>}
          </div>
        </div>
        <p className="footer">© Online-zapis.com</p>
      </div>
    );
  }

  resetPassword() {
    this.setState({ resetPasswordModal: true });
  }


  sendRequest() {
    const { dispatch } = this.props;
    const { forgottenEmail } = this.state;

    dispatch(userActions.forgotPass({ 'email': forgottenEmail }));
  }
}

function mapStateToProps(state) {
  const { authentication } = state;
  return {
    authentication,
  };
}

export default connect(mapStateToProps)(withTranslation("common")(Index));
